 @corey moss  The media is sensationalist and financially benefits from "outrage". The media also includes Fox, Limbaugh, Hannity, Ben Shapiro, etc. So saying "is bought and payed for by the left" is bs. The "media is owned by the left" is a weak persons way of denying things they don't like. 

Also, nearly everyone has decided to sensationalize instead of report and the few that still just report hardly anyone listens to. People have allowed themselves to be dumbed down and they need to be TOLD what to think, which all of these opinion shows are more than happy to do for both sides. 

For example: where the hell did the people who marched on the capitol for fiscal responsibility go? Totally evaporated once the right wing news media stopped TELLING PEOPLE what to think. Many Americans have become pathetic mindless zombies when it comes to politics.

 @888strummer  not everything is about trump, jeez. 
He is trying to point out the simple fact that everyone can make a difference in the world, we can't just sit back and hope someone else fixes the problems we care about. 
If people care about climate change,  they can make choices that make a difference,  like care pooling, eating less meat etc. Regardless of what you care about, you can make change from the bottom up, that is why the best way to help third world country is to invest in education. Educated populations make smarter choices that help their country, this man is just pointing out that somewhere along the way America seems to of forgotten that,  or lost confidence in themselves.
